;; **
;;; # CRP Mixture
;; **

;; @@
(ns crp-mixture
  (:use [anglican core runtime emit [state :only [get-predicts]]])
  (:require [clojure.core.matrix :as m]
            [clojure.core.matrix
             :refer [identity-matrix mmul add sub transpose]
             :rename {identity-matrix eye
                      add madd
                      sub msub
                      transpose mtranspose}]
            clojure.string))
