;; **
;;; Define wrappers to treat XRPs in the same way as ERPs
;; **

;; @@
;; From here: https://bitbucket.org/dtolpin/embang/src/7820bc382837c983c37ed2585bb2783b34f69bf6/code/src/anglib/xrp.clj?at=master
(defm XRP
  "binds a random process to a XRP,
  returns the XRP"
  [proc]
  (let [xrp (gensym "xrp")]
    (store xrp proc)
    xrp))

(defm OBSERVE
  "observes a value w.r.t. either an ERP or an XRP"
  [dist value]
  (if (symbol? dist)
    (let [proc (retrieve dist)]
      (observe (produce proc) value)
      (store dist (absorb proc value)))
    (observe dist value)))

(defm SAMPLE
  "samples from either an ERP or an XRP"
  [dist]
  (if (symbol? dist)
    (let [proc (retrieve dist)
          s (sample (produce proc))]
      (store dist (absorb proc s))
      s)
    (sample dist)))

(defm SAMPLE*
  "blindly (for LMH) samples from either ERP or XRP"
  [dist]
  (if (symbol? dist)
    (let [proc (retrieve dist)
          s (sample* (produce proc))]
      (store dist (absorb proc s))
      s)
    (sample* dist)))

