;; **
;;; Define helper functions
;; **

;; @@
(defn vec-sum
  "sum of list of vectors"
  [x]
  (reduce m/add x))

(defn vec-mean
  "mean of list of vectors"
  [x]
  (m/div (vec-sum x) (count x)))

(defn vec-unnorm-cov
  "sample covariance of list of vectors, not divided by N"
  [x]
  (let [mean (vec-mean x)
        count (count x)
        sum-sq (reduce m/add
                       (map (fn [x-i]
                              (let [diff (m/sub x-i mean)]
                                (m/mmul (m/transpose [diff])
                                        [diff])))
                            x))]
    sum-sq))

(defn produce-matrix-from-vector
  [input-vector]
  (m/reshape input-vector [(count input-vector) 1]))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;crp-mixture/produce-matrix-from-vector</span>","value":"#'crp-mixture/produce-matrix-from-vector"}
