;; <=

;; **
;;; Now we are ready to actually run CRP Mixture model on a synthetic data set
;; **

;; **
;;; Let us generate synthetic data by generating 20 points from 3 different clusters
;; **

;; @@
(defn get-points-for-cluster
  [cluster n]
  (repeatedly n (fn [] (sample cluster))))

(def number-of-points-per-cluster 20)

(def cluster-1-datapoints (get-points-for-cluster (mvn [10 10] [ [0.5 0] [0.0 0.5] ]) number-of-points-per-cluster))

(def cluster-2-datapoints (get-points-for-cluster (mvn [-10 -10] [ [0.5 0] [0.0 0.5] ]) number-of-points-per-cluster))

(def cluster-3-datapoints (get-points-for-cluster (mvn [10 -10] [ [0.5 0] [0.0 0.5] ]) number-of-points-per-cluster))

(def all-datapoints (concat cluster-1-datapoints cluster-2-datapoints cluster-3-datapoints))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;crp-mixture/all-datapoints</span>","value":"#'crp-mixture/all-datapoints"}
;; <=

;; **
;;; Now let us define the CRP Mixture model
;; **

;; @@
(with-primitive-procedures
  [mvn-conjugate-fast random-colour]
  (defquery crp-mixture
    "crp-mixture"
    [all-datapoints]
    (let
      [ clusters (mem (fn clusters [id] (XRP (mvn-conjugate-fast mu-0 k-0 nu-0 Lambda-0))))
        clusters-colours (mem (fn clusters-colours [id] (random-colour)))
        my-crp (crp 1.0)
        points-assignments (mem (fn points-assignments [point-id] (my-crp)))]
      (map
        (fn [x id]
          (OBSERVE (clusters (points-assignments id)) x))
        all-datapoints (range (count all-datapoints)))
      (predict
        :mypredict
        (map
          (fn [data-point id]
            (list
              data-point
              (clusters-colours (points-assignments id))
              ))
          all-datapoints (range (count all-datapoints)))))))
        
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;crp-mixture/crp-mixture</span>","value":"#'crp-mixture/crp-mixture"}
;; <=

;; **
;;; Let's use LMH to get samples
;; **

;; @@
(def states (doquery :lmh crp-mixture [all-datapoints]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;crp-mixture/states</span>","value":"#'crp-mixture/states"}
;; <=

;; **
;;; And finally let us output prediction
;; **

;; @@
(def points-with-colours (first (take 1 (drop 500 (map (fn [x] (get x :mypredict)) (map get-predicts states))))))

(def common-range [[-15 15] [-15 15]])
  
(def plots
  (map
    (fn [x] (list-plot [(vec (first x))] :color (second x) :plot-range common-range :symbol-size 30 :opacity 0.5))
      points-with-colours))
        
(apply compose plots)

